  true,\n\t\"url\": null,\n\t\"notes\": \"A national survey conducted to obtain information
  about enrollment in formal schools, full-time and part-time status, and level of
  education.  It is also used to obtain information about enrollment in business,
  vocational, technical, and correspondence courses.  The universe for this survey
  are household members age 3 and older.  It is a proxy response survey that is sponsored
  by the National Center for Education Statistics (NCES), Bureau of Labor Statistics
  (BLS) and the United States Census Bureau.\",\n\t\"license_title\": \"U.S. Government
